<?php

namespace PracticeCore\Zwuiix\network\proto\v361\packets;

use pocketmine\network\mcpe\protocol\AvailableActorIdentifiersPacket;
use pocketmine\network\mcpe\protocol\serializer\PacketSerializer;

class v361AvailableActorIdentifiersPacket extends AvailableActorIdentifiersPacket{

	/**
	 * Hardcoded NBT blob extracted from MCPE vanilla server.
	 * TODO: this needs to be generated dynamically, but this is here for stable backwards compatibility, so we don't care for now.
	 */
	private const HARDCODED_NBT_BLOB = "";
	public string $namedtag;

	protected function decodePayload(PacketSerializer $in) : void{
		$this->namedtag = $in->getRemaining();
	}

	protected function encodePayload(PacketSerializer $out) : void{
		$out->put($this->namedtag ?? base64_decode(self::HARDCODED_NBT_BLOB));
	}
}